import React, { Component } from "react";
import {
  Container,
  Content,
  Left,
  Right,
  Header,
  Button,
  Icon,
  Body,
  Title,
  Text,
} from "native-base";
import {
  StyleSheet,
  View,
  FlatList,
  Dimensions,
  ActivityIndicator,
  Platform,
} from "react-native";

export default class Fitnessinfo extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      events: [],
      eventsFormatted: {},
    };
  }

  componentDidMount() {
    this.loadEvents();
    this.focusListener = this.props.navigation.addListener("focus", () =>
      this.loadEvents()
    );
  }

  componentWillUnmount() {
    this.focusListener();
  }

  loadEvents = (day) => {
    //Charge les items du mois
    fetch("http://192.168.178.23:9000/api/fitnessevents")
      .then((events) => {
        console.log(`events: ${JSON.stringify(events)}`);
        return events;
      })
      .then((events) => {
        var eventsFormatted = {};
        if (events.length) {
          events.map((event) => {
            let day = event.start.toDate().toISOString().split("T")[0]; // Format to YYYY-MM-DD
            if (eventsFormatted[day]) {
              eventsFormatted[day].push(event);
            } else {
              eventsFormatted[day] = [event];
            }
          });
          this.setState({
            eventsFormatted: eventsFormatted,
          });
          console.log(`eventsFormatted: ${JSON.stringify(eventsFormatted)}`);
        }
      });
  };

  render() {
    return (
      <>
        <View style={{ flex: 1, backgroundColor: "white", paddingBottom: 30 }}>
          <Agenda
            style={styles.calendar}
            selected={"2012-05-16"}
            loadEvents={(day) => this.loadEvents(day)}
            events={this.state.eventsFormatted}
            onPressEvent={(event) =>
              this.props.navigation.navigate("Login", { event })
            }
          />
        </View>
      </>
    );
  }
}
